import React from "react";
import { List, ListItem, ListItemIcon, ListItemText, Stack, Typography } from "@mui/material";
import DehazeIcon from '@mui/icons-material/Dehaze';

type PlaylistProps = {
  links: Array<string>;
};

function Playlist({ links }: PlaylistProps) {
  return (
    // <List sx={{ py: 0, alignItems: "center" }}>
    //   {links.map((link) => (
    //     <ListItem sx={{ px: 2 }} key={`${link}${Date.now()}`}>
    //       <ListItemIcon>
    //         <DehazeIcon fontSize="large"/>
    //       </ListItemIcon>
    //       <ListItemText primary={link} primaryTypographyProps={{ fontSize: '30px' }} ></ListItemText>
    //       {/* variant="h4"
    //       component="h1"
    //       sx={{ m: -1, p: 2 }}

    //       {link} */}
    //     </ListItem>
    //   ))}
    // </List>
    <>
      {links.map((link) => (
        <Stack direction="row" alignItems="center" gap={1}>
          <DehazeIcon fontSize="large"/>
          <Typography variant="h4"
              component="h1"
              sx={{ m: -1, p: 2 }}
          >  
            {link}
          </Typography>
        </Stack>
      ))}
    </>
  );
}

export default Playlist;
